import React from "react";
import './scroll.css'



const Scroll =(props)=>{
    return (
        <div style={{
            overflowY: 'scroll', 
            padding:'6px', 
            height:'800px', 
            style:'none',
            }}>

            {props.children}
        </div>
    )

};

export default Scroll;
